import './App.css';
import Video from './component /video';
import data from './component /data/data';
import { useState } from 'react';


function App() {

 const [video, setVideo] = useState([{
  firstName: 'Rockybul',
  lastName: 'Hussain',
  fatherName: 'Matiur Rahaman',
  age: 20,
  gender: 'Male',
  city: 'Ranchi',
  country: 'India',
  class: 'sem-3',
 }])
 console.log(video)

 const obj = {
  userFirstName: 'Khabib',
  userLastName: 'Nurmagomedov',
  userAge: 34,
  userGender: 'Male',
  userCountry: 'Russia',
 }
 setVideo(obj)



  return (
    <div className='container'>
      {data.map(video => {
        return <Video
        id={video.id}
        key={video.id}
        title={video.title}
        channelName={video.channelName}
        isVerified={video.isVerified}
        view={video.view}
        time={video.time}
        ></Video>
      })}
    </div>
  );
}

export default App;
